public class MethodDemo5 {

	/**
	 * @param args
	 */

	public static void numbering(int start, int limit) {
		for (int i = start; i < limit; i++) {
			System.out.println(i);
		}
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		numbering(1, 5);
	}

}
